import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // Assuming you will create a Home.css for specific styles

const Home = () => {
    return (
        <div className="home-container">
            <h1>Welcome to Budget Manager</h1>
            <p>Manage your personal and business finances efficiently.</p>
            <div className="navigation">
                <Link to="/personal" className="nav-link">Personal Finances</Link>
                <Link to="/business" className="nav-link">Business Finances</Link>
            </div>
        </div>
    );
};

export default Home;
